import React from 'react';
import { createStyles, Theme, makeStyles } from '@material-ui/core/styles';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import Image from 'material-ui-image'
import AccountCircle from '@material-ui/icons/AccountCircle';
import LockIcon from '@material-ui/icons/Lock';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Checkbox, { CheckboxProps } from '@material-ui/core/Checkbox';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import { url } from 'inspector';

export default function Homepage() {
    return (
        <div>
        <Grid
            container
            spacing={2}
            direction="column"
            alignItems="center"
            style={{ minHeight: '50vh', width: '25%', position: 'absolute', background: 'white',
            left: '20%', top: '50%', transform: 'translate(-50%, -50%)' }}
        >
        </Grid>

        <Grid
            container
            spacing={2}
            direction="column"
            alignItems="center"
            style={{ minHeight: '50vh', width: '25%', position: 'absolute', background: 'white',
            left: '50%', top: '50%', transform: 'translate(-50%, -50%)' }}
        >
            <Image
                style={{ visibility:'visible', background: '#00bcd4' ,
                width: '1000px', height: '40px', align: 'right'}}
                src="running.jpg"
            />
        </Grid>

        <Grid
            container
            spacing={2}
            direction="column"
            alignItems="center"
            style={{ minHeight: '50vh', width: '25%', position: 'absolute', background: 'white',
            left: '80%', top: '50%', transform: 'translate(-50%, -50%)' }}
        >
        </Grid>
        </div>
    );
}
